    <p>Follow us!</p>
    <a href="https://www.instagram.com/jsa_oberlin/" target="_blank" rel="noopener noreferrer">
        <FontAwesomeIcon icon={faInstagram} size="2x" />
      </a>
    </div>

    );

};

export default Home;
